package main

import (
    "github.com/FactomProject/factomd/common/directoryBlock/dbInfo"
    "fmt"
    "encoding/hex"
)

var dirBytes = ``

func main() {

    dbInfo := dbInfo.NewDirBlockInfo()
    dbInfo.UnmarshalBinary([]byte(dirBytes))

    fmt.Println("dbinfo is ", dbInfo)
    fmt.Println("chainid ", dbInfo.GetChainID())
    by, err := hex.DecodeString(dirBytes)
    if err != nil {
        fmt.Println("Decode error ", err)
    }
    fmt.Println("decode is %q", (by))
}
